import React from 'react';

const HooksRule = props => {
    return (
        <React.Fragment>
            <ul>
                <li>Only Call Hooks at the Top Level<br/><p>Don't use inside nested function or level</p></li>
                <li>Always use at root level of function component</li>
            </ul>
        </React.Fragment>
    )
}

export default HooksRule;
